import { createDrawerNavigator } from "@react-navigation/drawer";

import Home from "../screens/home/Home";
import MyRooms from "../screens/manage/my-rooms/MyRooms";
import MyRoomsForRent from "../screens/manage/my-rooms-for-rent/MyRoomsForRent";
import DrawerContent from "../components/CustomDrawer";

const Drawer = createDrawerNavigator();

const AuthStack = () => {
  return (
    <Drawer.Navigator
      drawerContent={(props) => <DrawerContent {...props} />}

    >
      <Drawer.Screen name="Home" component={Home} />
      <Drawer.Screen name="MyRooms" component={MyRooms} />
      <Drawer.Screen name="MyRoomsForRent" component={MyRoomsForRent} />
    </Drawer.Navigator>
  );
};

export default AuthStack;
